import React from 'react'
import './Url.css'
import 'tachyons'

const Url = () => {
	return (
		<div className='background'>
			<p className='f4'>Enter the image link to detect a face</p>
			<div className='inner-background dib w-40 ba'>
				<input className='bg-light-yellow ma3 w-70' type= 'text' placeholder='Enter the URL'></input>
				<button className='bg-light-yellow ma3 w3 tc mr2'>Detect</button>
			</div>
		</div>
	);
}


export default Url;
